import React from 'react';
import BandForm from '../components/Band/BandForm';
import ButtonRandom from '../components/ButtonRandom';
import Menu from '../components/Menu';


const FormP = () => {
    return (
        <>
            
            <div>
                <BandForm />
            </div>
            <div>
                <ButtonRandom />
            </div>
            <div>
                <Menu />
            </div>
        </>
    );
};

export default FormP;
